Пожар в прилегающей к вашей квартире.

Если возникло возгорание в квартире на этаже ниже вашей, следует покинуть квартиру, при условии, что вы находитесь от выхода из парадной или источника пожара на расстоянии не более трех этажей. Иначе вы можете попасть в ловушку огня или задохнуться по пути.

В случае, когда огонь охватил помещения над вашей квартирой, считается, что прямой угрозы нет, так как огонь распространяется по направлению вверх, тем не менее, рекомендуется выйти на улицу. Предварительно следует обесточить квартиру на электрощите и вызвать противопожарную службу.

На случай, если огонь настиг вас, отрезав пути отхождения, вам следует:

-затворить все окна, двери, каналы вентиляции, если на них отсутствует заслонка – заткнуть увлажненной тканью;

-обесточите квартиру;

-полейте пол и входную дверь водой из шланга;

-защитить органы дыхания смоченной тканью или воспользоваться фильтрующим противогазом, можно также применить для дыхания в дымном помещении кусок шланга, выпущенного из окна;

-вызвать противопожарную службу;

-искать способы выбраться из квартиры  через примыкающий балкон, свесив самодельный канат из влажного постельного белья, связанного по диагонали прямым узлом и прикрепленного к батарее.
